function PageNotFound() {
  return (
    <body className='d-flex flex-column min-vh-100 justify-content-center'>
      <div style={{marginTop: -100}}>
          <img className='d-block mx-auto' src="https://cdn-icons-png.flaticon.com/512/103/103085.png?w=360" alt="" />
          <h1 className='text-center'>ບໍ່ພົບຫນ້າທີ່ທ່ານຄົ້ນຫາ</h1>
          <h2 className='text-center'>Error 404 page not found</h2>
      </div>

    </body>
  )
}

export default PageNotFound
